      'body' => array(
        'und' => array(
          array(
            'value' => "<p>We want to look if a newly reported source is observed also with JEM-X in a given time range (1-5 May 2021)</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/query.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"156\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/query.png?itok=JQctMUjd\" width=\"480\" /> </a></p>\r\n\r\n<p>Then, we need to fill the query for the JEM-X image. Note that you need to select the unit to use, as well as a suitable energy range. For more insight look at the <a href=\"https://www.isdc.unige.ch/integral/download/osa/doc/11.1/osa_um_jemx/man.html\" target=\"_blank\">JEM-X user manual</a></p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jemx-image-query.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"480\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jemx-image-query.png?itok=aIdpk696\" width=\"180\" /> </a></p>\r\n\r\n<p>after you click submit, you will receive an email and another one at job completion.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jemx-email.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"227\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jemx-email.png?itok=yfvvG-xf\" width=\"480\" /> </a></p>\r\n\r\n<p>When you click on the url you will be directed to the page and you close the popup</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/done-lemx.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"120\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/done-lemx.png?itok=bpAA09p1\" width=\"480\" /> </a></p>\r\n\r\n<p>To finally get the image with a new source</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jem-x-image.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"379\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jem-x-image.png?itok=phEYnG_U\" width=\"480\" /> </a></p>\r\n\r\n<p>At this point, you can visualize the catalog and you want to change the \"flag\" to 1. To do that, select the source and click on edit.</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/catalogjemx.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"373\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/catalogjemx.png?itok=Hbe_PY1-\" width=\"480\" /> </a></p>\r\n\r\n<p>you will have a popup</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/edit-source.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"375\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/edit-source.png?itok=tforTnit\" width=\"480\" /> </a></p>\r\n\r\n<p>click on save and then on use catalog to use the catalog for the jem-x spectral or light-curve extraction. <strong>Remember to unselect the source before use catalog is hit ! Otherwise only the selected source is used.</strong></p>\r\n",
            'summary' => '',
            'format' => 'full_html',
            'safe_value' => "<p>We want to look if a newly reported source is observed also with JEM-X in a given time range (1-5 May 2021)</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/query.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"156\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/query.png?itok=JQctMUjd\" width=\"480\" /> </a></p>\n\n<p>Then, we need to fill the query for the JEM-X image. Note that you need to select the unit to use, as well as a suitable energy range. For more insight look at the <a href=\"https://www.isdc.unige.ch/integral/download/osa/doc/11.1/osa_um_jemx/man.html\" target=\"_blank\">JEM-X user manual</a></p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jemx-image-query.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"480\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jemx-image-query.png?itok=aIdpk696\" width=\"180\" /> </a></p>\n\n<p>after you click submit, you will receive an email and another one at job completion.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jemx-email.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"227\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jemx-email.png?itok=yfvvG-xf\" width=\"480\" /> </a></p>\n\n<p>When you click on the url you will be directed to the page and you close the popup</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/done-lemx.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"120\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/done-lemx.png?itok=bpAA09p1\" width=\"480\" /> </a></p>\n\n<p>To finally get the image with a new source</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/jem-x-image.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"379\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/jem-x-image.png?itok=phEYnG_U\" width=\"480\" /> </a></p>\n\n<p>At this point, you can visualize the catalog and you want to change the \"flag\" to 1. To do that, select the source and click on edit.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/catalogjemx.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"373\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/catalogjemx.png?itok=Hbe_PY1-\" width=\"480\" /> </a></p>\n\n<p>you will have a popup</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-jemx/edit-source.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"375\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-jemx/edit-source.png?itok=tforTnit\" width=\"480\" /> </a></p>\n\n<p>click on save and then on use catalog to use the catalog for the jem-x spectral or light-curve extraction. <strong>Remember to unselect the source before use catalog is hit ! Otherwise only the selected source is used.</strong></p>\n",
